import './ItemDate.css'

function ItemDate(){
    const day=7;
    const month="december";
    const year=2002;

    return (
        <div className='mfg'>
            <span>{day}</span>
            <span>{month}</span>
            <span>{year}</span>
        </div>
    );
}

export default ItemDate;
